pragma solidity ^0.8.4;

////import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
////import "@openzeppelin/contracts/access/Ownable.sol";
////import "hardhat/console.sol";

contract MToken is ERC20,Ownable {

    uint256 minHoldAmount = 10 ** 16;
    address public market;
    uint256 public transferFee = 10;// 10/1000

    mapping (address => bool) private _isAllowedContract;
    mapping (address => bool) private _isExcludedFromFee;
    constructor(address _market) ERC20("MOJUE","MOJUE"){
        _mint(msg.sender, 980_000 * 10 ** decimals());
        market = _market;
        
        _isExcludedFromFee[owner()] = true;
        _isExcludedFromFee[address(this)] = true;
        _isExcludedFromFee[market] = true;

    }

    function decimals() public pure override returns (uint8) {
        return 18;
    }

    function burn(uint256 amount) external{
        _burn(msg.sender, amount);
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        _tokenTransfer(_msgSender(), recipient, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        _spendAllowance(sender, _msgSender(),amount);
        _tokenTransfer(sender, recipient, amount);        
        return true;
    }

    function _tokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal {
        // if(isContract(to)){
        //     require(isAllowedContract(to), "not allowed contract" );
        // }

        uint256 fromBalance = balanceOf(from);
        require(fromBalance >= amount && fromBalance > minHoldAmount, "M:insufficent token");
        if(fromBalance < amount + minHoldAmount){
            amount = fromBalance - minHoldAmount;
        }

        if(!isExcludedFromFee(from) && !isExcludedFromFee(to)){
            uint256 transfee = amount * transferFee / 1000;
            amount -= transfee;
            _transfer(from, market, transfee); 
        }

        _transfer(from, to, amount);
    }

    function allowContract(address account) public onlyOwner {
        _isAllowedContract[account] = true;
    }
    
    function unAllowContract(address account) public onlyOwner {
        _isAllowedContract[account] = false;
    }

    function isAllowedContract(address account) public view returns(bool) {
        return _isAllowedContract[account];
    }

    function isContract(address account) internal view returns (bool) {
        // This method relies on extcodesize/address.code.length, which returns 0
        // for contracts in construction, since the code is only stored at the end
        // of the constructor execution.

        return account.code.length > 0;
    }

    function excludeFromFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = true;
    }
    
    function includeInFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = false;
    }

    function isExcludedFromFee(address account) public view returns(bool) {
        return _isExcludedFromFee[account];
    }


}
